import React from 'react';
import { Provider } from 'react-redux';
import { HashRouter } from 'react-router-dom';
// We'll create this soon
import App from '../App';
import NavBar from '../components/nav_bar'

const Root = ({ store }) => (
    <Provider store={store}>
        <HashRouter>
            <NavBar />
            <App />
        </HashRouter>
    </Provider>
);

export default Root;
